import React from 'react';

const ChineseRestaurantSection = () => {
  return (
    <section className="chinese-restaurant-section">
      <div className="section-content">
        <h1 style={{ fontSize: '1.5em', fontWeight: 'bold', margin: '0' }}>
          Bienvenido al Sabor Auténtico de China
        </h1>
        <p>
          Descubre una experiencia culinaria única en nuestro restaurante chino, donde la tradición se encuentra con la innovación.
        </p>
        <p>
          Nuestro menú variado ofrece delicias que van desde platillos clásicos hasta creaciones modernas,
          preparadas con ingredientes frescos y auténticos sabores chinos.
        </p>
        <p>
          Disfruta de la hospitalidad china y sumérgete en una mezcla única de sabores en un ambiente acogedor y elegante.
        </p>
        {/* Agrega más contenido relevante */}
      </div>
    </section>
  );
};

export default ChineseRestaurantSection;
